import React, { Component } from "react";
import firebase from "../../firebase";

class DemographicsForm extends Component {

    state = {};
    render() {
        return (
            <form>
                <label>Grade</label>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" id="inlineRadio1" value="Freshman"></input>
                    <label class="form-check-label" for="inlineRadio1">Freshman</label>
                </div>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" id="inlineRadio2" value="Sophomore"></input>
                    <label class="form-check-label" for="inlineRadio2">Sophomore</label>
                </div>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" id="inlineRadio3" value="Junior"></input>
                    <label class="form-check-label" for="inlineRadio3">Junior</label>
                </div>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" id="inlineRadio4" value="Senior"></input>
                    <label class="form-check-label" for="inlineRadio4">Senior</label>
                </div>
            </form>
        );
    }
}

export default DemographicsForm;
